import React from 'react';
import './Unscramble.css';

import Header from './Header';
import GameBoard from "./GameBoard";
import Footer from "./Footer";

function Unscramble() {
  return (
    <div className='unscramble'>
      <Header />
      <GameBoard />
      <Footer />
    </div>
  );
}

export default Unscramble;
